// components/RecipeList.js
import React from 'react';

const RecipeList = ({ recipes }) => {
  return (
    <div>
      <h2>Recipes</h2>
      <ul>
        {recipes.map((recipe, index) => (
          <li key={index}>
            <a href={`/recipe/${index}`}>{recipe.recipe.label}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RecipeList;
